<!doctype html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport"
          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
    <meta http-equiv="X-UA-Compatible" content="ie=edge">
    <title>Document</title>
    <style>
        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
        }

        body {
            font-family: DejaVu Sans, sans-serif;
            font-size: 11px;
        }

        .border-bottom {
            border-bottom: 1.2px solid #7a7a7a;
            padding-bottom: 10px;
            margin-bottom: 10px;
        }

        .header-container {
            width: 100%;
            overflow: hidden;
            margin-bottom: 10px;
        }

        .header-container-rtl {
            width: 100%;
            overflow: hidden;
            margin-bottom: 10px;
            text-align: right;
        }

        .header-logo {
            float: left;
            width: 40px;
            height: 40px;
            margin-right: 10px;
        }

        .header-logo-rtl {
            float: right;
            width: 40px;
            height: 40px;
            margin-left: 10px;
        }

        .header-logo img,.header-logo-rtl img {
            width: 100%;
            height: 100%;
            object-fit: contain;
        }

        .header-info {
            overflow: hidden;
            color: #7a7a7a;
        }

        .header-info p {
            margin: 0;
        }

        .company-name {
            color: #c3b019;
            font-weight: bold;
            font-size: 14px;
        }

        .company-info {
            font-weight: bold;
            font-size: 12px;
            color: #7a7a7a;
        }

        .header-time {
            text-align: right;
            font-size: 12px;
            color: #7a7a7a;
            margin-top: -20px; /* Adjust this value to align it properly */
        }

        .header-time-rtl {
            text-align: left;
            font-size: 12px;
            color: #7a7a7a;
            margin-top: -20px; /* Adjust this value to align it properly */
        }

        .color-gray {
            color: #7a7a7a;
            font-size: 12px;
        }

        .company-info-2 {
            color: #c3b019;
            font-size: 12px;
            font-weight: bold;
        }

        .header{
            display:none;
        }
    </style>
    <script>
        function check() {
            // Show or hide the additional-info div based on the page number
            var page = getParameterByName('page');
            var header = document.getElementById('header');

            if (page > 1 && header) {
                header.style.display = 'block'; // Show if page number is greater than 1
            }
        }

        function getParameterByName(name) {
            var match = RegExp('[?&]' + name + '=([^&]*)').exec(window.location.search);
            return match && decodeURIComponent(match[1].replace(/\+/g, ' '));
        }

    </script>
</head>
<body onload="check()">
<div id="header" class="header">
        <div class="border-bottom">
            <div class="{{($direction == 'ltr')? 'header-container': 'header-container-rtl' }}">
                <div class="{{($direction == 'ltr')? 'header-logo': 'header-logo-rtl' }}" dir="{{ $direction }}">
                    <img alt="logo" src="data:image/png;base64," />
                </div>
                <div class="header-info" dir="{{ $direction }}">
                    <p>
                        <span class="company-name">LegalPDF.co</span><br>
                        <span class="company-info">{{ localize('email_and_chat_extractor',$language) }}</span>
                    </p>
                </div>
                <div class="{{($direction == 'ltr')? 'header-time': 'header-time-rtl' }}"  dir="{{ $direction }}">
                    <p>
                        <span class="color-gray">{{$dateAt}}  at {{$timeAt}}</span><br>
                        <span class="company-info-2">{{ localize('fast_and_secured',$language) }}</span>
                    </p>
                </div>
            </div>
        </div>
</div>
</body>
</html>
